 import React from 'react'

function Hardwares() {
   return (
     <div><h1>Hardwares</h1>
      <p>There are three Hardwares in Luanda Kotieno in case you are costructing a 
        building in Luanda kotieno there are materials available in the hadwares 
        though not in a bulk quantity but you can find a good quantity </p>
     </div>
   )
 }

 export default Hardwares;
